INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Dostawa', 'Nasze zasady i warunki dostawy', 'conditions, delivery, delay, shipment, pack', '<h2>Przesyłki i zwroty</h2>\r\n<h3>Twoja przesyłka paczkowa</h3>\r\n<p>Paczki są zazwyczaj wysyłane w ciągu jednego dnia od otrzymania płatności i wysyłane za pośrednictwem wybranej firmy.</p>\r\n<p>Opłaty za przewóz różnią się w zależności od ceny całości zakupu. Radzimy grupować produkty w jednym zamówieniu. Nie możemy grupować dwóch odrębnych zamówień złożonych osobno, a opłaty za wysyłkę będą miały zastosowanie do każdego z nich. Za bezpieczne dostarczenie przesyłki odpowiada firma przewoźnicza.</p>\r\n<p>Dostępne oferty przewozu:</p>\r\n<table><tbody><tr><td>Firma</td>\r\n<td>Przedział</td>\r\n<td>Cena*[zł]</td>\r\n</tr><tr><td>Kurier</td>\r\n<td>do 100 zł</td>\r\n<td>6</td>\r\n</tr><tr><td></td>\r\n<td>do 10 000 zł</td>\r\n<td>8</td>\r\n</tr><tr><td>Poczta</td>\r\n<td>do 100 zł</td>\r\n<td>3</td>\r\n</tr><tr><td></td>\r\n<td>do 10 000 zł</td>\r\n<td>4</td>\r\n</tr></tbody></table><p>* - cena netto</p>', 'dostawa'),
(2, 1, 1, 'Nota prawna', 'Nota prawna', 'notice, legal, credits', '<h2>Słowa podziękowania</h2>\r\n<p>Strona stworzona w oparciu o:<br />    <a href="http://www.prestashop.com">PrestaShop</a>™ open-source software.</p>\r\n<p>Twórcy strony:</p>\r\n<p>    Jacek Ardanowski</p>\r\n<p>    Paweł Blajer</p>\r\n<p>    Amadeusz Chmielowski</p>\r\n<p>    Władysław Jakołcewicz</p>\r\n<p>    Studenci 5 semestru Informatyki na wydziale ETI z Politechniki Gdańskiej</p>', 'legal-notice'),
(3, 1, 1, 'Regulamin użytkowania', 'Nasz regulamin użytkowania', 'conditions, terms, use, sell', '<p>Regulamin sklepu internetowego</p>\r\n<p style="text-align:center;">§ 1</p>\r\n<p style="text-align:left;">1. Sklep internetowy TerraFelis, dostępny pod adresem internetowym http://terrafelis.ddns.net</p>\r\n<p style="text-align:left;">2. Niniejszy regulamin skierowany jest do Konsumentów i określa zasady i tryb zawierania z Konsumentem Umowy Sprzedaży na odległość za pośrednictwem Sklepu.</p>\r\n<p style="text-align:center;">§ 2</p>\r\n<p style="text-align:center;">Definicje 1.</p>\r\n<p style="text-align:left;">Konsument ​- <strong>o</strong>soba fizyczna zawierająca ze Sprzedawcą umowę w ramach Sklepu, której przedmiot nie jest związany bezpośrednio z jej działalnością gospodarczą lub zawodową.</p>\r\n<p style="text-align:left;">2. Sprzedawca ​- TerraFelis sp. z. o. o.</p>\r\n<p style="text-align:left;">3. Klient ​- każdy podmiot dokonujący zakupów za pośrednictwem Sklepu.</p>\r\n<p style="text-align:left;">4. Przedsiębiorca ​- osoba fizyczna, osoba prawna i jednostka organizacyjna niebędąca osobą prawną, której odrębna ustawa przyznaje zdolność prawną, wykonująca we własnym imieniu działalność gospodarczą, która korzysta ze Sklepu.</p>\r\n<p style="text-align:left;">5. Sklep ​- sklep internetowy prowadzony przez Sprzedawcę pod adresem interntowym terrafelis.ddns.net</p>\r\n<p style="text-align:left;">6. Umowa zawarta na odległość - umowa zawarta z Klientem w ramach zorganizowanego systemu zawierania umów na odległość (w ramach Sklepu), bez jednoczesnej fizycznej obecności stron, z wyłącznym wykorzystaniem jednego lub większej liczby środków porozumiewania się na odległość do chwili zawarcia umowy włącznie.</p>\r\n<p style="text-align:left;">7. Regulamin ​- niniejszy regulamin Sklepu.</p>\r\n<p style="text-align:left;">8. Zamówienie ​- oświadczenie woli Klienta składane za pomocą Formularza Zamówienia i zmierzające bezpośrednio do zawarcia Umowy Sprzedaży Produktu lub Produktów ze Sprzedawcą.</p>\r\n<p style="text-align:left;">9. Konto - konto klienta w Sklepie, są w nim gromadzone są dane podane przez Klienta oraz informacje o złożonych przez niego Zamówieniach w Sklepie.</p>\r\n<p style="text-align:left;">10. Formularz rejestracji ​- formularz dostępny w Sklepie, umożliwiający utworzenie Konta.</p>\r\n<p style="text-align:left;">11. Formularz zamówienia - interaktywny formularz dostępny w Sklepie umożliwiający złożenie Zamówienia, w szczególności poprzez dodanie Produktów do Koszyka oraz określenie warunków Umowy Sprzedaży, w tym sposobu dostawy i płatności.</p>\r\n<p style="text-align:left;">12. Koszyk ​– element oprogramowania Sklepu, w którym widoczne są wybrane przez Klienta Produkty do zakupu, a także istnieje możliwość ustalenia i modyfikacji danych Zamówienia, w szczególności ilości produktów.</p>\r\n<p style="text-align:left;">13. Produkt ​- dostępna w Sklepie rzecz ruchoma/usługa będąca przedmiotem Umowy Sprzedaży między Klientem a Sprzedawcą.</p>\r\n<p style="text-align:left;">14. Umowa Sprzedaży - umowa sprzedaży Produktu zawierana albo zawarta między Klientem a Sprzedawcą za pośrednictwem Sklepu internetowego. Przez Umowę Sprzedaży rozumie się też - stosowanie do cech Produktu - umowę o świadczenie usług i umowę o dzieło.</p>\r\n<p style="text-align:center;">§ 3</p>\r\n<p style="text-align:center;">Kontakt ze Sklepem</p>\r\n<p style="text-align:left;">1. Adres Sprzedawcy: Polska</p>\r\n<p style="text-align:left;">2. Adres e-mail Sprzedawcy: biznes.elektroniczne@gmail.com</p>\r\n<p style="text-align:left;">3. Numer rachunku bankowego Sprzedawcy PL01 2345 6789 0123 4567 8901 2345</p>\r\n<p style="text-align:left;">6. Klient może porozumiewać się ze Sprzedawcą za pomocą adresów i  podanych w niniejszym paragrafie.</p>\r\n<p style="text-align:left;">7. Klient może porozumieć się telefonicznie ze Sprzedawcą w godzinach 08:00-16:00</p>\r\n<p style="text-align:center;">§ 4</p>\r\n<p style="text-align:center;">Wymagania techniczne</p>\r\n<p style="text-align:left;">Do korzystania ze Sklepu, w tym przeglądania asortymentu Sklepu oraz składania zamówień na Produkty, niezbędne są:</p>\r\n<p style="text-align:left;">a. urządzenie końcowe z dostępem do sieci Internet i przeglądarką internetową</p>\r\n<p style="text-align:left;">b. aktywne konto poczty elektronicznej (e-mail),</p>\r\n<p style="text-align:left;">c. włączona obsługa plików cookies,</p>\r\n<p style="text-align:left;">d. zainstalowany program FlashPlayer.</p>\r\n<p style="text-align:center;">§ 5</p>\r\n<p style="text-align:center;">Informacje ogólne</p>\r\n<p style="text-align:left;">1. Sprzedawca w najszerszym dopuszczalnym przez prawo zakresie nie ponosi odpowiedzialności za zakłócenia w tym przerwy w funkcjonowaniu Sklepu spowodowane siłą wyższą, niedozwolonym działaniem osób trzecich lub niekompatybilnością Sklepu internetowego z infrastrukturą techniczną Klienta.</p>\r\n<p style="text-align:left;">2. Przeglądanie asortymentu Sklepu nie wymaga zakładania Konta. Składanie zamówień przez Klienta na Produkty znajdujące się w asortymencie Sklepu możliwe jest albo po założeniu Konta zgodnie z postanowieniami § 6 Regulaminu<span style="font-size:11px;"> albo przez podanie niezbędnych danych osobowych i adresowych umożliwiających realizację Zamówienia bez zakładania Konta. wersja dla sklepów prowadzących sprzedaż w złotówkach</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 3. Ceny podane w Sklepie są podane w polskich złotych i są cenami brutto (uwzględniają podatek VAT).</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">4. Na końcową (ostateczną) kwotę do zapłaty przez Klienta składa się cena za Produkt oraz koszt dostawy (w tym opłaty za transport, dostarczenie i usługi pocztowe), o której Klient jest informowany na stronach Sklepu w trakcie składania Zamówienia, w tym także w chwili wyrażenia woli związania się Umową Sprzedaży.</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 5. W przypadku Umowy obejmującej prenumeratę lub świadczenie usług na czas nieoznaczony końcową (ostateczną) ceną jest łączna cena obejmująca wszystkie płatności za okres rozliczeniowy. </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">6. Gdy charakter przedmiotu Umowy nie pozwala, rozsądnie oceniając, na wcześniejsze obliczenie wysokości końcowej (ostatecznej) ceny, informacja o sposobie, w jaki cena będzie obliczana, a także o opłatach za transport, dostarczenie, usługi pocztowe oraz o innych kosztach, będzie podana w Sklepie w opisie Produktu.</span></p>\r\n<p style="text-align:center;"><span style="font-size:11px;"> § 6</span></p>\r\n<p style="text-align:center;"><span style="font-size:11px;"> Zakładanie Konta w Sklepie</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 1. Aby założyć Konto w Sklepie, należy wypełnić Formularz rejestracji. Niezbędne jest podanie następujących danych: nazwa kontaktu, imię, nazwisko oraz e-mail</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 2. Założenie Konta w Sklepie jest darmowe.</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 3. Logowanie się na Konto odbywa się poprzez podanie loginu i hasła ustanowionych w Formularzu rejestracji.</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 4. Klient ma możliwość w każdej chwili, bez podania przyczyny i bez ponoszenia z tego tytułu jakichkolwiek opłat usunąć Konto poprzez wysłanie stosownego żądania do Sprzedawcy, w szczególności za pośrednictwem poczty elektronicznej lub pisemnie na adresy podane w § 3. </span></p>\r\n<p style="text-align:center;"><span style="font-size:11px;">§ 7 </span></p>\r\n<p style="text-align:center;"><span style="font-size:11px;">Zasady składania Zamówienia</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> W celu złożenia Zamówienia należy:</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 1. zalogować się do Sklepu (opcjonalnie);</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 2. wybrać Produkt będący przedmiotem Zamówienia, a następnie kliknąć przycisk „Do koszyka” (lub równoznaczny);</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 3. zalogować się lub skorzystać z możliwości złożenia Zamówienia bez rejestracji;</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 4. jeżeli wybrano możliwość złożenia Zamówienia bez rejestracji - wypełnić Formularz zamówienia poprzez wpisanie danych odbiorcy Zamówienia oraz adresu, na który ma nastąpić dostawa Produktu, wybrać rodzaj przesyłki (sposób dostarczenia Produktu), wpisać dane do faktury, jeśli są inne niż dane odbiorcy Zamówienia,</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 5. kliknąć przycisk “Zamawiam i płacę”/kliknąć przycisk “Zamawiam i płacę” oraz potwierdzić zamówienie, klikając w link przesłany w wiadomości e-mail, </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">6. wybrać jeden z dostępnych sposobów płatności i w zależności od sposobu płatności, opłacić zamówienie w określonym terminie, z zastrzeżeniem § 8 pkt 3. </span></p>\r\n<p style="text-align:center;"><span style="font-size:11px;">§ 8 </span></p>\r\n<p style="text-align:center;"><span style="font-size:11px;">Oferowane metody dostawy oraz płatności </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">1. Klient może skorzystać z następujących metod dostawy lub odbioru zamówionego Produktu: </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">a. Przesyłka pocztowa,</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> b. Przesyłka kurierska,</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> c. Odbiór osobisty dostępny pod adresem jednego z salonów</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">2. Klient może skorzystać z następujących metod płatności: </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">a. Płatność przy odbiorze</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">b. Płatność przelewem na konto Sprzedawcy </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">c. Wysłanie czeku</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 3. Szczegółowe informacje na temat metod dostawy oraz akceptowalnych metod płatności znajdują się za stronach Sklepu.</span></p>\r\n<p style="text-align:center;"><span style="font-size:11px;"> § 9 </span></p>\r\n<p style="text-align:center;"><span style="font-size:11px;">Wykonanie umowy sprzedaży</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 1. Zawarcie Umowy Sprzedaży między Klientem a Sprzedawcą następuje po uprzednim złożeniu przez Klienta Zamówienia za pomocą Formularza zamówienia w Sklepie internetowym zgodnie z § 7 Regulaminu. </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">2. Po złożeniu Zamówienia Sprzedawca niezwłocznie potwierdza jego otrzymanie oraz jednocześnie przyjmuje Zamówienie do realizacji. Potwierdzenie otrzymania Zamówienia i jego przyjęcie do realizacji następuje poprzez przesłanie przez Sprzedawcę Klientowi stosownej wiadomości e-mail na podany w trakcie składania Zamówienia adres poczty elektronicznej Klienta, która zawiera co najmniej oświadczenia Sprzedawcy o otrzymaniu Zamówienia i o jego przyjęciu do realizacji oraz potwierdzenie zawarcia Umowy Sprzedaży. Z chwilą otrzymania przez Klienta powyższej wiadomości e-mail zostaje zawarta Umowa Sprzedaży między Klientem a Sprzedawcą.</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 3. W przypadku wyboru przez Klienta:</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> a. płatności przelewem, płatności elektronicznych albo płatności kartą płatniczą, Klient obowiązany jest do dokonania płatności w terminie 14 dni kalendarzowych od dnia zawarcia Umowy Sprzedaży - w przeciwnym razie zamówienie zostanie anulowane. </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">b. płatności za pobraniem przy odbiorze przesyłki, Klient obowiązany jest do dokonania płatności przy odbiorze przesyłki. </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">c. płatności gotówką przy odbiorze osobistym przesyłki, Klient obowiązany jest dokonać płatności przy odbiorze przesyłki w terminie 14 dni od dnia otrzymania informacji o gotowości przesyłki do odbioru. </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">4. Jeżeli Klient wybrał sposób dostawy inny niż odbiór osobisty, Produkt zostanie wysłany przez Sprzedawcę w terminie wskazanym w jego opisie (z zastrzeżeniem ustępu 5 niniejszego paragrafu), w sposób wybrany przez Klienta podczas składania Zamówienia. </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">5. W przypadku zamówienia Produktów o różnych terminach dostawy, terminem dostawy jest najdłuższy podany termin.</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">6. Początek biegu terminu dostawy Produktu do Klienta liczy się w następujący sposób:</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> a. W przypadku wyboru przez Klienta sposobu płatności przelewem, płatności elektroniczne lub kartą płatniczą - od dnia uznania rachunku bankowego Sprzedawcy.</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> b. W przypadku wyboru przez Klienta sposobu płatności za pobraniem – od dnia zawarcia Umowy Sprzedaży, </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">c. W przypadku wyboru przez Klienta odbioru osobistego Produktu, Produkt będzie gotowy do odbioru przez Klienta w terminie wskazanym w opisie Produktu. O gotowości Produktu do odbioru Klient zostanie dodatkowo poinformowany przez Sprzedawcę poprzez przesłanie stosownej wiadomości e-mail na podany w trakcie składania Zamówienia adres poczty elektronicznej Klienta. wersja dla sklepów dostarczających zamówienia w całości po wykonaniu wszystkich części zamówienia </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">7. W przypadku zamówienia Produktów o różnych terminach gotowości do odbioru, terminem gotowości do odbioru jest najdłuższy podany termin. wersja dla sklepów dostarczających zamówienia w całości po wykonaniu wszystkich części zamówienia </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 8. Początek biegu terminu gotowości Produktu do odbioru przez Klienta liczy się w następujący sposób: </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">a. W przypadku wyboru przez Klienta sposobu płatności przelewem, płatności elektroniczne lub kartą płatniczą - od dnia uznania rachunku bankowego Sprzedawcy. </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">b. W przypadku wyboru przez Klienta sposobu gotówką przy odbiorze osobistym – od dnia zawarcia Umowy Sprzedaży. wersja dla sklepów prowadzących sprzedaż na terenie Polski </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">9. Dostawa Produktu odbywa się wyłącznie na terenie Polski. wersja dla sklepów prowadzących sprzedaż na terenie innym niż Polska </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">9. Dostawa Produktu odbywa się na terenie ……………….... (Unii Europejskiej, Europy, etc)</span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;"> 10. Dostawa Produktu do Klienta jest odpłatna, chyba że Umowa Sprzedaży stanowi inaczej. Koszty dostawy Produktu (w tym opłaty za transport, dostarczenie i usługi pocztowe) są wskazywane Klientowi na stronach Sklepu internetowego w zakładce „Koszty dostawy” oraz w trakcie składania Zamówienia, w tym także w chwili wyrażenia przez Klienta woli związania się Umową Sprzedaży. </span></p>\r\n<p style="text-align:left;"><span style="font-size:11px;">11. Odbiór osobisty Produktu przez Klienta jest bezpłatny.</span></p>', 'terms-and-conditions-of-use'),
(4, 1, 1, 'O nas ', 'Dowiedz się więcej o naszej firmie', 'about us, informations', '<h2>O nas </h2>\r\n<h3>Nasza firma</h3>\r\n<p>Sprzedajemy rzeczy dla zwierząt.</p>\r\n<h3>Nasz zespół</h3>\r\n<p>Zespół firmy TerraFelis składa się z najlepsiejszych informatyków</p>\r\n<h3>Informacje</h3>\r\n<p>Możesz się nie zgadzać z opinią o naszym zespole, ale wiedz, że nie masz racji</p>', 'about-us');
