INSERT INTO `ps_translation` (`id_translation`, `id_lang`, `key`, `translation`, `domain`, `theme`) VALUES
(1, 1, 'All best sellers', 'Najlepiej sprzedające', 'ModulesBestsellersShop', 'classic'),
(2, 1, 'Security policy (edit with Customer reassurance module)', 'Polityka bezpieczeństwa\nGwarancja na każdy produkt na 12 miesięcy', 'ModulesBlockreassuranceShop', 'classic'),
(3, 1, 'Delivery policy (edit with Customer reassurance module)', 'Zasady dostawy\nDostawa nawet do 1 dnia po zamówieniu!', 'ModulesBlockreassuranceShop', 'classic'),
(4, 1, 'your@email.com', 'twoj@email.com', 'ModulesMailalertsShop', 'classic'),
(5, 1, 'The module %s has been disabled', 'Ten moduł %s został wyłączony', 'messages', NULL),
(6, 1, 'An error has occurred.', 'Wystąpił błąd', 'messages', NULL),
(7, 1, 'Please upload one file at a time, .zip. Your child theme will be installed right after that.', 'Proszę załaduj po jednym pliku .zip na raz. Twój motyw zostanie zainstalowany zaraz po tym.', 'messages', NULL),
(8, 1, 'select file', 'Wybierz plik', 'messages', NULL),
(9, 1, 'Drop your child theme archive here or', 'Załaduj twoje archiwum motywu tu lub', 'messages', NULL),
(10, 1, 'We will review your request and reply as soon as possible.', 'Sprawdzimy twoje żądanie i odpiszemy tak szybko jak się da.', 'messages', NULL),
(11, 1, 'contact page', 'strona kontaktowa', 'messages', NULL),
(12, 1, 'You have the right to modify all the personal information found in the "My Account" page. For any other request you might have regarding the rectification and/or erasure of your personal data, please contact us through our', 'Możesz modyfikować wszystkie informacje osobiste na stronie "Moje Konto". W razie potrzeby innych sprostowań, lub usunięcia danych osobistych skontaktuj się z nami poprzez ', 'messages', NULL),
(13, 1, 'Rectification & Erasure requests', 'Żądania sprostowań i usunięć danych', 'messages', NULL),
(14, 1, 'GET MY DATA TO PDF', 'Konwertuj dane do PDF', 'messages', NULL),
(15, 1, 'GET MY DATA TO CSV', 'Konwertuj dane do CSV', 'messages', NULL),
(16, 1, 'At any time, you have the right to retrieve the data you have provided to our site. Click on "Get my data" to automatically download a copy of your personal data on a pdf or csv file.', 'W każdej chwili możesz pobrać dane, które podałeś na tej stronie. Kliknij w "Pobierz moje dane", by automatycznie pobrać kopię twoich danych osobistych do pliku pdf lub csv.', 'messages', NULL),
(17, 1, 'Access to my data', 'Dostęp do moich informacji', 'messages', NULL),
(18, 1, 'My personal data', 'Moje dane osobiste', 'messages', NULL),
(19, 1, 'Contact us on PrestaShop Addons', 'Skontaktuj się z nami na PrestaShop Addons', 'messages', NULL),
(20, 1, 'You couldn''t find any answer to your question ?', 'Nie mogłeś znaleźć odpowiedzi na twoje pytanie?', 'messages', NULL),
(21, 1, 'Find here the documentation of this module', 'Tu znajdziesz dokumentacje tego modułu', 'messages', NULL),
(22, 1, 'Need help ?', 'Potrzebujesz pomocy?', 'messages', NULL),
(23, 1, 'marty_modifier_capitalize($_smarty_tpl->tpl_vars[''module'']->value[''url_active'']', 'marty_modifier_capitalize($_smarty_tpl->tpl_vars[''module'']->value[''url_active'']', 'messages', NULL),
(24, 1, 'FAQ', 'FAQ', 'messages', NULL),
(25, 1, 'View all your customers’ actions related to their personal data', 'Zobacz wszystkie działania swoich klientów związane z ich danymi osobowymi', 'messages', NULL),
(26, 1, 'Allow your customer to consult and export their personal data collected by your shop on their customer account', 'Pozwól klientowi skonsultować i wyeksportować jego dane osobowe zebrane przez Twój sklep na ich koncie klienta', 'messages', NULL),
(27, 1, 'Add a consent confirmation checkbox in a module form that collects personal data and customize it', 'Dodaj pole wyboru potwierdzenia zgody w formularzu modułu, które gromadzi dane osobowe i dostosowuje je', 'messages', NULL),
(28, 1, 'Erase any customer account with his/her personal data collected by your shop if requested by the customer', 'Usuń dowolne konto klienta ze swoich danych osobowych zebranych przez Twój sklep, jeśli klient tego zażąda', 'messages', NULL),
(29, 1, 'This module allows you to :', 'Ten moduł umożliwia:', 'messages', NULL),
(30, 1, 'Help & contact', 'Pomoc i kontakt', 'messages', NULL),
(31, 1, 'Erasure', 'Skasowanie', 'messages', NULL),
(32, 1, 'Accessibility', 'Dostępność', 'messages', NULL),
(33, 1, 'Consent confirmation', 'Potwierdzenie zgody', 'messages', NULL),
(34, 1, 'Submission date', 'Termin składania', 'messages', NULL),
(35, 1, 'Type of request', 'Typ prośby\n', 'messages', NULL),
(36, 1, 'Client name/ID', 'Nazwa/identyfikator klienta', 'messages', NULL),
(37, 1, 'Keep track of your customer activity related to data accessibility, consent and erasure.', 'Śledź aktywność klientów związaną z dostępnością, zgodą i usunięciem danych.\n', 'messages', NULL),
(38, 1, 'Customer activity list', 'Lista aktywności klientów\n', 'messages', NULL),
(39, 1, 'to configure the modules and take all necessary actions to ensure compliance. For any questions, we recommend you to contact a lawyer specializing in personal data legislation questions.', 'aby skonfigurować moduły i podjąć wszystkie niezbędne działania w celu zapewnienia zgodności. W przypadku jakichkolwiek pytań zalecamy skontaktowanie się z prawnikiem specjalizującym się w kwestiach dotyczących danych osobowych.', 'messages', NULL),
(40, 1, 'It is your own responsibility', 'To twoja własna odpowiedzialność', 'messages', NULL),
(41, 1, 'Build article', 'Utwórz artykuł', 'messages', NULL),
(42, 1, 'Video', 'Video', 'messages', NULL),
(43, 1, 'Module''s documentation', 'Dokumentacja modułu', 'messages', NULL),
(44, 1, 'PrestaShop GDPR whitepaper', 'Dokument PrestaShop GDPR', 'messages', NULL),
(45, 1, 'Data protection authorities websites', 'Witryny organów ochrony danych', 'messages', NULL),
(46, 1, 'More information about GDPR', 'Więcej informacji na temat GDPR', 'messages', NULL),
(47, 1, 'Note : Please make sure that you have access to the latest version of your installed module(s) to fully benefit the features of our GDPR module. If one or several of your modules do not provide their data list, we invite you to contact directly the developers of these modules.', 'Uwaga: upewnij się, że masz dostęp do najnowszej wersji zainstalowanego modułu (modułów), aby w pełni korzystać z funkcji naszego modułu GDPR. Jeśli jeden lub kilka modułów nie udostępnia swojej listy danych, zapraszamy do bezpośredniego kontaktu z twórcami tych modułów.', 'messages', NULL),
(48, 1, 'Visualize all of your customers’ actions related to their data and manage the erasure requests.', 'Wizualizuj wszystkie działania swoich klientów związane z ich danymi i zarządzaj żądaniami usunięcia.', 'messages', NULL),
(49, 1, 'Keep track', 'Śledź', 'messages', NULL),
(50, 1, 'Customize the consent confirmation checkboxes and consent request message on the different forms of your store, especially for account creation and newsletter subscription.', 'Dostosuj pola wyboru potwierdzenia zgody i wiadomość o zgodzie na różne formy swojego sklepu, szczególnie w przypadku tworzenia konta i subskrypcji biuletynu.', 'messages', NULL),
(51, 1, 'See our Personal data management tab to visualize the data collected by PrestaShop and community modules and manage your customers’ personal data.', 'Zobacz naszą zakładkę Zarządzanie danymi osobowymi, aby zwizualizować dane zebrane przez PrestaShop i moduły społecznościowe oraz zarządzać danymi osobowymi swoich klientów.', 'messages', NULL),
(52, 1, 'Manage', 'Zarządzaj', 'messages', NULL),
(53, 1, 'Follow our 3 steps to configure your module and help you to become GDPR compliant !', 'Wykonaj nasze 3 kroki, aby skonfigurować swój moduł i pomóc Ci osiągnąć zgodność z GDPR!', 'messages', NULL),
(54, 1, 'It also allows you to keep a record of processing activities (especially for access, consent and erasure).', 'Pozwala również na prowadzenie rejestru działań związanych z przetwarzaniem (szczególnie w zakresie dostępu, zgody i usunięcia).', 'messages', NULL),
(55, 1, 'The right to give and withdraw consent', 'Prawo do udzielania i wycofywania zgody', 'messages', NULL),
(56, 1, 'The right to obtain rectification and/or erasure of their personal data', 'Prawo do sprostowania i / lub usunięcia ich danych osobowych', 'messages', NULL),
(57, 1, 'The right to access their personal data and data portability', 'Prawo do dostępu do swoich danych osobowych i możliwości przenoszenia danych', 'messages', NULL),
(58, 1, 'This module meets the main regulation''s requirements concerning personal data of your customers including :', 'Moduł ten spełnia główne wymagania prawne dotyczące danych osobowych Twoich klientów, w tym:', 'messages', NULL),
(59, 1, 'This interface will help you to become familiar with the GDPR and give you some guidance to help you become compliant with this regulation.', 'Ten interfejs pomoże ci zapoznać się z GDPR i poda ci wskazówki, które pomogą ci osiągnąć zgodność z tym rozporządzeniem.', 'messages', NULL),
(60, 1, 'Welcome to your GDPR module', 'Witamy w Twoim module GDPR', 'messages', NULL),
(61, 1, 'The customer''s data has been successfully deleted!', 'Dane klienta zostały pomyślnie usunięte!', 'messages', NULL),
(62, 1, 'Confirm Erasure', 'Potwierdź usunięcie', 'messages', NULL),
(63, 1, 'Url has been copied to the clipboard!', 'Url został skopiowany do schowka!', 'messages', NULL),
(64, 1, 'Version', 'Wersja', 'messages', NULL),
(65, 1, 'PHONE', 'Telefonelefon', 'messages', NULL),
(66, 1, 'EMAIL', 'Email', 'messages', NULL),
(67, 1, 'Proceed to checkout', 'Zrealizuj zamówienie', 'ShopThemeActions', 'classic');
